void mainImage( out vec4 O, in vec2 f )
{
    vec2 uv = f/iResolution.xy;
    float t = iTime,
        z = 37.37,
        k = sin(f.y*0.005 * (uv.x-0.5) - t*1.5)*233.0,
  // c= mod(fragCoord.x+k, z ) - z * 0.5,
       c = mod(f.x+k, z + mod(uv.y+t*-0.3,0.1) * 10.0 ) - z * sin(uv.x*1.5);
    O = vec4(c);
}
